import React from "react";

const countData = [
  {
    name: "New supplier of this month",
    value: 12,
    icon: <CheckCircleOutlined />,
    color: "#728FCE",
  },
  {
    name: "New Purchase order of this month",
    value: 12,
    icon: <CheckCircleOutlined />,
    color: "#728FCE",
  },
  {
    name: "Purchase amount of this month",
    value: 12,
    icon: <CheckCircleOutlined />,
    color: "#728FCE",
  },
];

const iconToElement = (name) => React.createElement(Icon[name]);

const Home = () => {
  return (
    <div className="num">
      {countData.map((item, index) => {
        return (
          <card key={index}>
            <div className="icon-box">{iconToElement(item.icon)}</div>
          </card>
        );
      })}
    </div>
  );
};

export default Home;
